import React, { useEffect, useState } from "react";

function Link(props){
    let[id,setId]=useState(props.id);
    let[value,setValue]=useState(props.value);

    const handleClick = () => {
        props.handleClick(props.category,props.id);
    }

    return(
        <div>
            <a href="#" onClick={handleClick}>{value}</a>
        </div>
    );
}
export default Link;
